import React from "react";
import {useSelector} from "react-redux";

const Extension = () => {
    const callFlowsData = useSelector(state => state.callFlowsData);
    return (

        <table className="table table-sm table-striped table-bordered table-hover">
            <thead>
            <tr>
                <th>Extensions</th>
            </tr>
            </thead>
            <tbody>{
                callFlowsData.item === undefined ? null : (callFlowsData.item[0].data[0] !== undefined ? callFlowsData.item[0].data[0].numbers.map((item, i) => {

                        return (
                            <tr key={i}>

                                <td>
                                    {item}
                                </td>
                            </tr>
                        )

                    })
                    : null)}</tbody>
        </table>
    )

};


export default Extension;
